import React, { useState } from 'react';
import Contactusimg from './images/banner7imgd.png';
import './contactus.css';
import { FaFacebookF, FaWhatsapp, FaInstagram, FaTwitter } from 'react-icons/fa';

function ContactUs() {
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [phone, setPhone] = useState('');
  const [address, setAddress] = useState('');
  const [place, setPlace] = useState('');
  const [nameError, setNameError] = useState('');
  const [emailError, setEmailError] = useState('');
  const [phoneError, setPhoneError] = useState('');
  const [addressError, setAddressError] = useState('');
  const [placeError, setPlaceError] = useState('');
  

  const handleFormSubmit = () => {
    if (name === '') {
      setNameError('Enter a name');
      document.getElementById("name").style.border="solid 1px red"
      
    } else {
      setNameError('');
      document.getElementById("name").style.border=""
    }

    if (email === '') {
      setEmailError('Enter a email');
      document.getElementById("email").style.border="solid 1px red"
    } else {
      setEmailError('');
      document.getElementById("email").style.border=""
    }

    if (phone === '') {
      setPhoneError('Enter a phone number');
      document.getElementById("number").style.border="solid 1px red"
    } else {
      setPhoneError('');
      document.getElementById("number").style.border=""
    }

    if (address === '') {
      setAddressError('Enter a address');
      document.getElementById("address").style.border="solid 1px red"
    } else {
      setAddressError('');
      document.getElementById("address").style.border=""
    }

    if (place === '') {
      setPlaceError('Enter a place');
      document.getElementById("place").style.border="solid 1px red"
    } else {
      setPlaceError('');
      document.getElementById("place").style.border=""
    }

  };

  
  return (
    <div className="maindiv">
      <div className="inputdata">
      <input
          type='text'
          placeholder='Name'
          id='name'
          value={name}
          onChange={(e) => setName(e.target.value)}>

          {/* // style={nameError && { border: '2px solid red' }}> */}
          </input>
        {nameError && <p style={{ color: 'red' }}>{nameError}</p>}

        <input
          type='email'
          placeholder='Email'
          id='email'
          value={email}
          onChange={(e) => setEmail(e.target.value)}>
          {/* // style={emailError && { border: '2px solid red' }}> */}
        </input>
        {emailError && <p style={{ color: 'red' }}>{emailError}</p>}

        <input
          type='number'
          placeholder='Phone number'
          id='number'
          value={phone}
          onChange={(e) => setPhone(e.target.value)}>
          {/* // style={phoneError && { border: '2px solid red' }}> */}
         </input>
        {phoneError && <p style={{ color: 'red' }}>{phoneError}</p>}

        <input
          type='text'
          placeholder='Address'
          id='address'
          value={address}
          onChange={(e) => setAddress(e.target.value)}>
          {/* // style={addressError && { border: '2px solid red' }}> */}
        
            </input>
        {addressError && <p style={{ color: 'red' }}>{addressError}</p>}
        <input
          type='text'
          placeholder='Place'
          id='place'
          value={place}
          onChange={(e) => setPlace(e.target.value)}>
          {/* // style={placeError && { border: '2px solid red' }}> */}
        </input>
        {placeError && <p style={{ color: 'red' }}>{placeError}</p>}
        <button onClick={handleFormSubmit}>Submit</button>
      </div>
      <div className="contactusimg">
        <img src={Contactusimg} className="imgcontact" alt="" />
        <div className="c-text">
          <h4 className="icons">
            <FaFacebookF className="fa" />Facebook
          </h4>
          <h4 className="icons">
            <FaWhatsapp className="fa" />Whatsapp
          </h4>
          <h4 className="icons">
            <FaInstagram className="fa" />Instagram
          </h4>
          <h4 className="icons">
            <FaTwitter className="fa" />Twitter
          </h4>
        </div>
      </div>
    </div>
  );
}

export default ContactUs;





